import React from 'react'

export const GlobalFilter = ({filter, setFilter}) => {
  return (
    <div>
        <span>
            
            <input value={filter || ''} onChange={e=>setFilter(e.target.value)} placeholder="Ваша подсказка" className="border-2 border-black"/>
        </span>
    </div>
  )
}
